commit.message:
Support mixed-version clusters.

Examples:

POST to /v1/servers:
{"preset": "basic.json", "version": "master"}

POST to /v1/replica_sets:
{
  "preset": "basic.json",
  "version": "master",
  "members": [
            {},
            {"version": "30-release"},
            {"version": "26-release"}]}}

POST to /v1/sharded_clusters:

{
  "preset": "basic.json",
  "id": "my_id",
  "shards": [
    {
      "id": "sh-rs-01",
      "shardParams": {
        "version": "master",
        "members": [{"version": "30-release"}, {}]
      }
    },
    {
      "id": "sh-rs-02",
      "shardParams": {
        "version": "30-release",
        "members": [{}, {"version": "master"}]}}]}
